import { HttpClient } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { UntypedFormBuilder, UntypedFormGroup } from '@angular/forms';
import { Router } from '@angular/router';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent implements OnInit {
  loginForm!: UntypedFormGroup;
  constructor(private formbuilder: UntypedFormBuilder, private _http:HttpClient, private _router:Router ) { }

  ngOnInit(): void {
    this.loginForm = this.formbuilder.group({
      email: [''],
      password: ['']
    });
  }

  logIn() {

    this._http.get<any>('http://localhost:3000/signup').subscribe(
      (res) => {
        const user= res.find((a:any)=>{
          return a.email === this.loginForm.value.email && a.password === this.loginForm.value.password;
        });
         if (user) {
          alert(user.name + ' logged in successfully');
          this._router.navigate(['/restaurent']);
          this.loginForm.reset();
         } else {
          alert("Invalid credentials");
         }
        }, err=>{
          console.log(err);
        })
      }

  }


<div class="container background-image">
  <div class="row">
    <div class="col-md-6">
      <div class="card">
        <div class="text-center">
          <h1>Login</h1>
          <h5>You can login here!</h5>
        </div>
        <form [formGroup]="loginForm" (ngSubmit)="logIn()">
          <div class="mb-3">
            <label class="form-label"><strong>Email Address</strong></label>
            <input
              formControlName="email"
              type="email"
              class="form-control"
              id="exampleInputEmail1"
              placeholder="Email address"
            />
            <div *ngIf="f.email.touched && f.email.invalid" class="text-danger">
              <small *ngIf="f.email.errors?.required">Email is required.</small>
              <small *ngIf="f.email.errors?.email">Invalid email format.</small>
            </div>
          </div>
          <div class="mb-3">
            <label class="form-label"><strong>Password</strong></label>
            <input
              formControlName="password"
              type="password"
              class="form-control"
              id="exampleInputPassword1"
            />
            <div *ngIf="f.password.touched && f.password.invalid" class="text-danger">
              <small *ngIf="f.password.errors?.required">Password is required.</small>
              <small *ngIf="f.password.errors?.minlength">
                Password must be at least 6 characters.
              </small>
            </div>
          </div>
          <button type="submit" class="btn btn-primary">Login</button>
        </form>
        <a style="color: blue; margin-top: 10px;" routerLink="/signup">New User? Click to Sign up</a>
      </div>
    </div>
  </div>
</div>
